[caja/window-state]
start-with-sidebar=true
geometry='800x550+510+240'
start-with-status-bar=true
maximized=false
start-with-toolbar=true

[panel/general]
object-id-list=['menu-bar', 'file-browser', 'terminal', 'web-browser', 'notification-area', 'clock', 'show-desktop', 'window-list', 'workspace-switcher']
toplevel-id-list=['top', 'bottom']

[panel/toplevels/bottom]
expand=true
orientation='bottom'
screen=0
y-bottom=0
size=24
y=1056

[panel/toplevels/top]
expand=true
orientation='top'
screen=0
size=24

[panel/objects/workspace-switcher]
applet-iid='WnckletFactory::WorkspaceSwitcherApplet'
locked=true
toplevel-id='bottom'
position=0
object-type='applet'
panel-right-stick=true

[panel/objects/clock]
applet-iid='ClockAppletFactory::ClockApplet'
locked=true
toplevel-id='top'
position=0
object-type='applet'
panel-right-stick=true

[panel/objects/clock/prefs]
format='24-hour'
custom-format=''

[panel/objects/menu-bar]
locked=true
toplevel-id='top'
position=0
object-type='menu-bar'

[panel/objects/window-list]
applet-iid='WnckletFactory::WindowListApplet'
locked=true
toplevel-id='bottom'
position=20
object-type='applet'

[panel/objects/file-browser]
locked=true
launcher-location='/usr/share/applications/caja-browser.desktop'
toplevel-id='top'
position=10
object-type='launcher'

[panel/objects/notification-area]
applet-iid='NotificationAreaAppletFactory::NotificationArea'
locked=true
toplevel-id='top'
position=10
object-type='applet'
panel-right-stick=true

[panel/objects/show-desktop]
applet-iid='WnckletFactory::ShowDesktopApplet'
locked=true
toplevel-id='bottom'
position=0
object-type='applet'

[panel/objects/web-browser]
locked=true
launcher-location='/usr/share/applications/firefox.desktop'
toplevel-id='top'
position=30
object-type='launcher'

[panel/objects/terminal]
locked=true
launcher-location='/usr/share/applications/mate-terminal.desktop'
toplevel-id='top'
position=20
object-type='launcher'

