logfiles=['/var/log/vbox-setup.log.4', '/var/log/vbox-setup.log.3', '/var/log/vbox-setup.log.2', '/var/log/yum.log', '/var/log/dmesg', '/var/log/Xorg.0.log', '/var/log/vbox-setup.log.1', '/var/log/vmware-vmusr.log', '/var/log/Xorg.1.log', '/var/log/Xorg.5.log', '/var/log/Xorg.3.log', '/var/log/Xorg.4.log', '/var/log/spooler', '/var/log/firewalld', '/var/log/Xorg.9.log', '/var/log/maillog', '/var/log/grubby', '/var/log/vbox-setup.log', '/var/log/grubby_prune_debug', '/var/log/tallylog', '/var/log/wpa_supplicant.log', '/var/log/secure', '/var/log/cron', '/var/log/boot.log', '/var/log/messages', '/var/log/Xorg.2.log']
